import React, { Component } from 'react'

import '../../styles/normalize.scss'
import '../../styles/base.scss'

import ComponenteEditarConsoles from '../../pages/Perfil/EditarConsoles'
import View from "../view/view"


class EditarConsoles extends Component {
  render() {
    return (
      <View public={false}>
          <ComponenteEditarConsoles />
      </View>
    )
  }
}

export default EditarConsoles;
